import { box_header, Container, Logo } from "./styled";

const Header_Home = () => {
    return (
        <>
            <Container>
                <box_header></box_header>
                <Logo src="/static/img/blockchain.png" />
            </Container>
        </>
    )
}

export default Header_Home;
